    /**
     * 超出时间限制
     *
     * @param nums
     * @return
     */
    public int totalHammingDistance(int[] nums) {
        if (nums == null || nums.length <= 0) {
            return 0;
        }
        int res = 0;
        for (int i = 0; i < nums.length; i++) {
            for (int j = i + 1; j < nums.length; j++) {
                int count = hammingDistance(nums[i], nums[j]);
                res += count;
            }
        }
        return res;
    }

    private int hammingDistance(int x, int y) {
        int res = x ^ y;
        int count = 0;
        while (res != 0) {
            count += (res & 1);
            res = res >> 1;
        }
        return count;
    }
